
public class Pair {
    private String first;
    private String second;
    

		

	public Pair( String first, String second) {
		// TODO Auto-generated constructor stub
		this.first = first;
		this.second = second;
	
	}

	public String getFirst() {
		return first;
	}

	
	public String getSecond() {
		return second;
	}

	
	
    
}
